function getId(element) {
    

    var row = element.closest('tr').rowIndex;
    
    var Trap_ID = document.getElementById("myTable").rows[row].cells.item(0).innerHTML;
    var Floor_ID = document.getElementById("myTable").rows[row].cells.item(1).innerHTML;
    var Trap_name = document.getElementById("myTable").rows[row].cells.item(2).innerHTML;
    var Trap_Date = document.getElementById("myTable").rows[row].cells.item(3).innerHTML;
    var Trap_Amount = document.getElementById("myTable").rows[row].cells.item(4).innerHTML;
    var list = [Trap_ID ,Floor_ID, Trap_name , Trap_Date, Trap_Amount]
    console.log(list);
    return list
    }

function createPDF(element){
    var data = getId(element);
    var doc = new jsPDF();
    var imgData = "data:image/png;base64,";
    doc.addImage(imgData, 'PNG', 0, 0, 210,297);
    doc.setFontSize(20)
    doc.text(data[0], 105, 37)
    doc.text(data[1], 105, 59)
    doc.text(data[2], 90, 87)
    doc.text(data[3], 90, 117)
    doc.text(data[4], 115, 146)
    doc.save(`trap-track${data[3]}_${data[4]}.pdf`)
}




$(document).ready(function () {
    //document.getElementById("datetime").value = new Date().toLocaleDateString()
    function getTraps(x) {
        $("#myTable").find("tr:gt(0)").remove();
        var uri = ''
        if (!isNaN(parseInt(x))) {
            uri = `https://trap-track.herokuapp.com/api/traps/${x}`
        } else {
            uri = 'https://trap-track.herokuapp.com/api/traps'
        }
        $.ajax({
            type: 'GET',
            url: uri,
            cache: false,
            success: function (data) {
                console.log(data)
                data.forEach(element => {
                    if(element.Floor_ID == document.getElementById('f_id').value) {
                        $('#myTable').append(`<tr><td id=${element.Trap_ID}>${element.Trap_ID}</td><td id=${element.Trap_ID}>${element.Floor_ID}</td><td id=${element.Trap_ID}>${element.Trap_type}</td><td id=${element.Trap_ID}>${element.Time.substring(0, 10)}</td>
                       <td id=${element.Trap_ID}>${element.Bait_left}</td><td><input type="button" onclick="createPDF(this)" style=" height:50px; width:50px;
                         background: url('https://image.flaticon.com/icons/png/128/337/337946.png'); background-size: contain;"/></td></tr>`);
                    }

                });
            }
        })
        window.setTimeout(function () {
            table = document.getElementById('myTable')
            rows = table.getElementsByTagName('tr')
            for (i in rows) {

                if (!isNaN(parseInt(i)) && i > 0) {
                    table.rows[i].addEventListener('click', function (e) {
                        console.log(e.target.id)
                        if(!isNaN(parseInt(e.target.id))){
                            document.getElementById('t_id').value = e.target.id
                            document.getElementById('editModal').style.display = 'block'
                        }
                    })
                }
            }
        }, 1000);
    }
    document.getElementById('editBut').addEventListener('click',function(){
        name = document.getElementById("name2").value
        AOB = parseInt(document.getElementById("Bait2").value * 100)
        floor = document.getElementById('f_id').value
        trap = document.getElementById('t_id').value

        newData = {
            "Trap_type": name,
            "Floor_ID": floor,
            "Bait_left": AOB
        };
        console.log(newData)
        $.ajax({
            type: "PUT",
            url: `https://trap-track.herokuapp.com/api/traps/update/${trap}`,
            data: JSON.stringify(newData),
            dataType: 'json',
            contentType: 'application/json',
        });
        window.setTimeout(function () {
            document.getElementById('editModal').style.display = 'none'
            getTraps("hi")
        }, 1000);
        
    })
    document.getElementById('DelBut').addEventListener('click',function(){
        trap = document.getElementById('t_id').value

        $.ajax({
            type: "DELETE",
            url: `https://trap-track.herokuapp.com/api/traps/delete/${trap}`,
        });
        window.setTimeout(function () {
            document.getElementById('editModal').style.display = 'none'
            getTraps("hi")
        }, 1000);
        
    })
    document.getElementById('cancelBut').addEventListener('click',function(){
        document.getElementById('editModal').style.display = 'none'
    })
    document.getElementById('Trapsearch').addEventListener('click', function () {
        getTraps(document.getElementById('trapInput').value)
    })
    document.getElementById('add_new').addEventListener('click', function () {
        document.getElementById('contaner').style.display = 'block'
    })
    document.getElementById('test').addEventListener('click', function () {
        document.getElementById('myform2').submit()
    })

    function addTrap() {
        name = document.getElementById("name").value
        AOB = parseInt(document.getElementById("Bait").value * 100)
        floor = document.getElementById('f_id').value

        newData = {
            "Trap_type": name,
            "Floor_ID": floor,
            "Bait_left": AOB
        };
        console.log(newData)
        $.ajax({
            type: "POST",
            url: 'https://trap-track.herokuapp.com/api/traps/create',
            data: JSON.stringify(newData),
            dataType: 'json',
            contentType: 'application/json',
        });
        window.setTimeout(function () {
            document.getElementById('contaner').style.display = 'none'
            getTraps("hi")
        }, 1000);

    }
    document.getElementById("submit").addEventListener("click", function () {
        addTrap()
    })

    getTraps("hi")
});